package com.MITProjectService.bot.enums;public enum ServiceStateEnum {    ENABLED(1),    LOCKED(2),    DISABLED(3);    private final int val;    ServiceStateEnum(int val) {        this.val = val;    }    public int getVal() {        return val;    }    public static ServiceStateEnum fromValue(int value) {        for (ServiceStateEnum state : values()) {            if (state.val == value) {                return state;            }        }        throw new IllegalArgumentException("Invalid ServiceState value: " + value);    }}